import "./Submit.css";
import { React, useState } from "react";
import { Link } from "react-router-dom";
import Thanks from "../Thanks/Thanks";
import * as axios from "axios";
function Submit(props) {
  const [nextpage, setnextpage] = useState(false);
  // console.log(props.personalInfo, props.skills, props.covid, props.insights);
  console.log(props.skills )
  const skills = props.skills.map((sk)=>sk.experience)
  function finalSubmit(event) {
    event.preventDefault();
    axios.post("https://bootcamp-2022.devtest.ge/api/application#F1", {
      token: 'e8b2664d-0c34-423d-8c1a-d15ce9e08193',
      first_name: props.personalInfo.fname,
      last_name: props.personalInfo.lname,
      email: props.personalInfo.email,
      skills:[
        {
          experience: skills
        }
      ],
      work_preference:props.covid.work,
      had_covid:props.covid.contactValue,
      vaccinated:props.covid.vacinatedValue,
      will_organize_devtalk: props.insights.devTalks,
      devtalk_topic: props.insights.aboutYou,
      something_special: props.insights.speech

    }).then((res) => console.log("Posting Data", res)).catch(err => console.error(err))
    setnextpage(true);
  }

  if (!nextpage) {
    return (
      <div className="box">
        <div className="submit">
          <button onClick={finalSubmit}>Submit</button>
          <Link to={"./Insights"} style={{ textDecoration: "none" }}>
            <p>Go Back</p>
          </Link>
        </div>
      </div>
    );
  } else {
    return <Thanks />;
  }
}
export default Submit;
